import React from "react";
import { Link, Route, Routes } from "react-router-dom";

function Header() {
    return (
        <header className="header">
            <div className="header__logo"></div>
            <div>
            <Routes>
                <Route path="/sign-up" element={<Link to="/sign-in">Вход</Link>}></Route>
                <Route path="/sign-in" element={<Link to="/sign-up">Регистрация</Link>}></Route>
            </Routes>
            </div>

            {/* <Link to={link}>{title}</Link> // прописать стили, возможно обернуть в дополнительный див */}
        </header>
    );
}

export default Header;
